</li></ul>');
Compilation of Human Research Standards (2015 edition): <a href=\"http://www.hhs.gov/ohrp/international/index.html\" rel=\"nofollow\" target=\"_blank\">http://www.hhs.gov/ohrp/international/index.html</a>
</li></ul>');
and Operational Guidance for Ethics Review of Health-Related Research with
Human Participants published by WHO: <a href=\"http://whqlibdoc.who.int/publications/2011/9789241502948_eng.pdf?ua=1\" rel=\"nofollow\" target=\"_blank\">http://whqlibdoc.who.int/publications/2011/9789241502948_eng.pdf?ua=1</a></li></ul>');
or well-being? What is the potential value of the research for each of the
prospective beneficiaries?</li></ul>

<ul><li>Scientific validity: Is the investigation methodologically
valid and scientifically (and statistically) sound? Will the study generate
valid and reliable data that can be generalizable? Is the study feasible? Does
the study design ensure participants the health-care interventions they are
entitled to? If not, are there methodologically compelling reasons and are
participants protected from serious harm?</li></ul>

<ul><li>Fair participant selection: What are the criteria to include
and exclude participants? Is selection of participants based on scientific
criteria? Are research participants selected to minimize risks and maximize
potential benefits? If participants are vulnerable, are there any safeguards to
protect them? Are the risks and potential benefits of the study fairly
distributed?</li></ul>

<ul><li>Favorable risk-benefit ratio: Can the risks for participants
be minimized? Can potential benefits for individuals and society be improved?
Do the potential benefits for society and individuals outweigh the risks?</li></ul>

<ul><li>Informed consent: Is the information provided to potential
participants accurate, clear, relevant and complete? Are the recruitment
procedures, consent process and incentives appropriate for their culture and
context? Is there an appropriate plan for obtaining permission for those that
can?t consent for themselves? Are the participants being made aware of their
right to refuse to participate and are they actually free to refuse?</li></ul>

<ul><li>Respect for participants: How will the health and well-being
of participants be monitored to minimize harms? How will their privacy be
protected? Can participants withdraw from the study without penalty? What are
the plans of care after the study is completed? Will participants be given any
new information (including the results of the study)?</li></ul>

<p>(Adapted from (1) Emanuel E, Wendler D, Grady C. An ethical
framework for biomedical research. In: Emanuel E et al. eds. The Oxford
textbook of clinical research ethics. New York, NY: Oxford University Press;
2008: 123-135. (2) Emanuel E, Wendler D, Grady C. What makes clinical research
ethical? JAMA 2000;283:2701-27711. (3) Emanuel E, Wendler D, Killen J, Grady C.
What makes clinical research in developing countries ethical? The benchmarks of
ethical research. JID 2004;189:930-937.)</p>

